import { useState } from "react"
import Header from "../../components/Header/Header"
import Footer from "../../components/footer/Footer"
import "./photo.css"

const Photo = () => {
  const photo_qty = 9
  const photos = []
  for (let i = 1; i <= photo_qty; i++) {
    photos.push(`photo_${i}`)
  }
  const [photo, setNumberPhoto] = useState(photos[0])
  function handlePhoto(photo) {
   let current_photo = document.querySelector(`${photo}`)
   console.log(current_photo)
  }
  console.log(photo)
  return (
    <>
      <Header />
      <section className="main">
        <div className="photos">
          {photos.map((photo_num, number) => {
            return <div className={`${photo_num} photo`} key={number}></div>
          })}
        </div>
      </section>
      <Footer />
    </>
  )
}

export default Photo
